import React from "react";
import { NavLink } from "react-router-dom";

const Notes = () => {

return(
    <>
    
    
    <div className="container">

      <h1 className="bg-danger text-white">Uploaded Files
      <span className="ml-5"><a className="bg-dark text-white text-right">upload</a></span>
      </h1>
        <div className="row">
                
        <h1 id="notes">Subject Notes</h1>
          
          </div>
        </div>
      
    
    </>
);
};
export default Notes;
